import React, { Component }  from 'react';

class ListItem extends Component
{
  render()
  {
    return (
      <div style={{
        display: 'flex'
      }}>
        <img src={this.props.poster} />
        <div>
          <div>Movie Title</div>
          <div>Movie Description</div>
        </div>
      </div>
    );
  }
}

export default ListItem;
